String.prototype.replaceAll = function(reallyDo, replaceWith, ignoreCase) {  
    if(!RegExp.prototype.isPrototypeOf(reallyDo)){
        return this.replace(new RegExp(reallyDo,(ignoreCase ? "gi": "g")), replaceWith);
    }else{
        return this.replace(reallyDo, replaceWith);
    }
}

String.prototype.toUnicode = function(){
	var str = this;
	str = escape(this).toLocaleLowerCase().replace(/%u/gi,'\\u');
	return str;
}
String.prototype.toGB2312 = function(){
	var str = this;
	str = unescape(str.replace(/\\u/gi,'%u'));
	return str;
}
String.prototype.replaceEmoji = function(){
	var emojireg = this;
	var ranges = [
	    '\ud83c[\udf00-\udfff]',
	    '\ud83d[\udc00-\ude4f]',
	    '\ud83d[\ude80-\udeff]'
	];
	var reg = new RegExp(ranges.join('|'),'g');
	return emojireg.replace(reg,'');
}
function movePrevent(event){event.preventDefault();}
function newMap(){
	var map = {};
	var container = {};
	map.put = function(key,value){
		container[key]=value;
	};
	map.get = function(key){
		return container[key];
	};
	map.contains = function(key){
		return key in container;
	};
	map.remove = function(key){
		delete container[key];
	};
	map.keys = function(){
		var keyset = new Array();
		var count = 0;
		for(var key in container){
			keyset[count] = key;
			count++;
		}
		return keyset;
	};
	return map;
}
function testMap(){
	var map = newMap();
	map.put("a", "aaa");
	map.put("b","bbb");
	map.put("cc","cccc");
	map.put("c","ccc");
	map.remove("cc");
	var array = map.keys();
	for(var i in array) {
		alert("key:(" + array[i] +") <br>value: ("+map.get(array[i])+") <br>");
	}
}
